import React from 'react';
import './Intro.css';

function Intro() {
    return (
        <div className="intro-container">
            <div className="intro-text">
                <h1>What's up?</h1>
                <h3>Let me tell you a little bit about me:</h3>
                <br />
                <h5>
                    I am 23, and am a Master's Student (MS in AI) at Boston University
                    {/* ... rest of the text ... */}
                    Feel free to continue and read about what I do and connect!
                </h5>
            </div>
            <div className="intro-photos">
                <img src="../attachments/photos/cover.png" alt="Graduated" />
                <img src="../attachments/photos/family.jpg" alt="Family" />
            </div>
        </div>
    );
}

export default Intro;
